import PropTypes from "prop-types";
import styled from "./button.module.css"

function Button({text = "버튼"}) {
  return (
    <button
      style={{
        backgroundColor:"tomato",
        color:"white",
        cursor:"pointer",
        border:0,
        borderRadius:10
      }}
    >
      {text}
    </button>
  );
}

Button.propTypes = {
  text: PropTypes.string.isRequired,
};

export default Button;
